@Override
public int compareBottom(int doc) {
  // TODO: there are sneaky non-branch ways to compute
  // -1/+1/0 sign
  final long v2 = currentReaderValues.ints(doc);
  if (bottom > v2) {
    return 1;
  } else if (bottom < v2) {
    return -1;
  } else {
    return 0;
  }
}

